import React from "react"
import { Switch, Route } from "react-router-dom"

// eslint-disable-next-line import/no-anonymous-default-export
export default () => {
    return(
        <Switch>
            <Route exact path="/">
                login
            </Route>
            <Route exact path="/myClients">
                clientes
            </Route>

        </Switch>
    );
}
